/*Table structure for table `rights` */

DROP TABLE IF EXISTS `rights`;

CREATE TABLE `rights` (
  `Id` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键ID',
  `RightName` varchar(100) DEFAULT NULL COMMENT '权限名称',
  `ParentId` int(11) DEFAULT '0' COMMENT '上级ID',
  `ParentIds` varchar(500) DEFAULT NULL COMMENT '上级ID集合',
  `Verify` varchar(100) DEFAULT NULL COMMENT '权限标示',
  `Type` int(11) DEFAULT '0' COMMENT '0是功能权限，1 Url权限',
  `Url` varchar(800) DEFAULT NULL COMMENT '菜单链接',
  `Remark` varchar(500) DEFAULT NULL COMMENT '备注',
  `State` int(11) DEFAULT '0' COMMENT '状态 -1禁用 0正常',
  `Sort` int(11) DEFAULT '0' COMMENT '排序地段 低到高',
  `CreateTime` datetime DEFAULT NULL COMMENT '创建日期',
  `UpdateTime` datetime DEFAULT NULL COMMENT '更新日期',
  `RightLevel` int(11) NOT NULL DEFAULT '2' COMMENT '1:一级权限,2:二级权限,3:三级权限',
  PRIMARY KEY (`Id`)
) ENGINE=InnoDB AUTO_INCREMENT=201 DEFAULT CHARSET=utf8;

