/*Table structure for table `users` */

DROP TABLE IF EXISTS `users`;

CREATE TABLE `users` (
  `Id` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键ID',
  `LogName` varchar(50) NOT NULL COMMENT '登录名',
  `LogPwd` varchar(200) NOT NULL COMMENT '密码',
  `TrueName` varchar(50) DEFAULT NULL COMMENT '姓名',
  `Age` int(11) DEFAULT NULL COMMENT '年龄',
  `Email` varchar(100) DEFAULT NULL COMMENT '邮箱',
  `CompanyId` int(11) DEFAULT '0' COMMENT '公司ID',
  `DepartmentId` int(11) DEFAULT '0' COMMENT '部门ID',
  `AgencyNumber` varchar(40) DEFAULT NULL COMMENT '所在最低级机构编号',
  `AgencyNames` varchar(200) DEFAULT NULL COMMENT '所在机构名称存储，逗号相隔',
  `LeaderId` int(11) DEFAULT '0' COMMENT '上级直属领导ID',
  `LeaderIds` varchar(200) DEFAULT NULL COMMENT '上级IDs 包含自己,方便权限管理',
  `Phone` varchar(50) DEFAULT NULL COMMENT '电话',
  `Telephone` varchar(50) DEFAULT NULL COMMENT '座机',
  `IsSuperAdmin` int(11) DEFAULT '0' COMMENT '是否是超级管理员',
  `Remark` varchar(500) DEFAULT NULL COMMENT '备注',
